function Specialty(props) {
    const projectTypesList = props.projectTypes.map(projectType => <li>{projectType}</li>)
    return(
        <div>
            <h2>{props.title}</h2>
            <p>Types of projects</p>
            <ul>
                {projectTypesList}
            </ul>
        </div>
    )
    
}
export default Specialty
